import ProjectBoxRight from './ProjectBoxRight';
import TSUTEUNG from '../images/tsuteung.png';

const PROJECTS = [
    {
        name: "Project One",
        location: "Location One",
        briefDescription: "Brief description of Project One",
        fullDescription: "Full description of Project One",
        techStack: ["React", "Node.js"],
        responsibilities: "Responsibilities in Project One"
    },
    {
        name: "Project Two",
        location: "Location Two",
        briefDescription: "Brief description of Project Two",
        fullDescription: "Full description of Project Two",
        techStack: ["Vue", "Firebase"],
        responsibilities: "Responsibilities in Project Two"
    }
    // Add more projects as needed
];

function ScrollList() {
    return (
        <div>
            {/* <h1>this is gonna be a scroll list</h1> */}
            <ProjectBoxRight 
                x={1050}
                y={75}
                text="tsuteung"
                techStacks={['React', 'Node.js', 'HTML', 'CSS', 'JavaScript', 'Bootstrap']}
                backgroundImage={TSUTEUNG}
            />
            <ProjectBoxRight 
                x={1050}
                y={400}
                text="tsuteung"
                techStacks={['React', 'Node.js', 'HTML', 'CSS', 'JavaScript', 'Bootstrap']}
                backgroundImage={TSUTEUNG}
            />
        </div>
    );
}

export default ScrollList;
